import { memo, VFC } from "react";
import { Flex, Heading, Box, Link } from "@chakra-ui/react";

export const Header: VFC = memo(() => {
	return (
		<>
			<Flex
				as="nav"
				bg="teal.500"
				color="gray.50"
				align="center"
				justify="space-between"
				padding={{ base: 3, md: 5 }}
			>
				<Flex
					align="center"
					as="a"
					mr={8}
					_hover={{ cursor: "pointer" }}
				>
					<Heading as="h1" fontSize={{ base: "md", md: "lg" }}>
						42_transcendence
					</Heading>
				</Flex>
				<Flex
					align="center"
					fontSize="sm"
					flexGrow={2}
					display={{ base: "flex", md: "flex" }}
				>
					<Box pr={4}>
						<Link>Chat</Link>
					</Box>
					<Box pr={4}>
						<Link>Game</Link>
					</Box>
				</Flex>
			</Flex>
		</>
	);
});
